INSERT INTO `v1_681669ded50dd2e1e5383ffb7e245e4ba5cc63e3e042204f7715915e7b409a80` VALUES (0, 5, 0.5, 0, 513, "クウカはこんな新年早々に\n豪華な料理とたくさんの人の前で\nドSさんに弄ばれ辱めを……！\nぐふふ……ぐふふふふ。", 11, 0, 104511, 1, 513048);
